import React from 'react';
import { Bar } from 'react-chartjs-2';

export default class BarGraph extends React.Component {
    render() {
        return (
            <div style={{height: "250px", display:"flex",width: "500px", justifyContent:"center",position: "relative", alignItems:"center"}}>
                <Bar
                    data={this.props.data}
                    options={{
                        legend:{
                            display: false
                        },
                       responsive: true,
                       title: {text: 'FUNCIÓN DISTRIBUCIÓN', display: true},
                       scales:{
                           yAxes:[
                               {
                                   ticks:{
                                        autoSkip: true,
                                        beginAtZero: true,
                                        min: 0,
                                   }
                               }
                           ]
                       }
                    }}
                />
            </div>
        );
    }
}
